  "title": {
    "nb": "Enhetsregisteret"
  },
  "description": {
    "nb": "Enhetsregisteret har som hovedoppgave å samordne opplysninger om næringslivet og offentlige etater som finnes i ulike offentlige registre. Enhetsregisteret inneholder grunndata om enheter som har registreringsplikt i NAV Aa-registeret, Merverdiavgiftsregisteret, Foretaksregisteret, Statistisk sentralbyrås bedriftsregister, Skattedirektoratets register over upersonlige skatteytere eller Stiftelsesregisteret. Alle registrerte enheter identifiseres med en entydig identifikator, et ni-sifret organisasjonsnummer.Fra data.brreg.no og hotell.difi.no kan du benytte API for både søk i og nedlasting av komplett datasett. Ved direkteoppslag får du tilgang til informasjon fra data.brreg.no i sanntid. Fra hotell.difi.no er det i hovedsak en forsinkelse i oppdateringshyppighet på ca 8-24 t. Komplett datasett for begge tjenenstene er basert forhåndsprodusert uttrekk hver natt (med unntak av natt til lørdag og mandag, hvor det ikke produseres filbasert datauttrekk).Datasettet omfatter utvalgte informasjonselementer for samtlige registrerte enheter i Enhetsregisteret, med unntak av organisasjonsformene TVAM (tvangsregistrert for mva), BEDR (underenheter/avdeling), AAFY (underenhet til ikke-næringsdrivende enhet) og UTLA (utenlandsk enhet). Enheter som er slettet i Enhetsregisteret er utelatt i datafilen. I overkant av 1 000 000 enheter inngår i datasettet, hvorav enkeltpersonforetak og aksjeselskap utgjør ca 80 % av bestanden (tall per 01.11.15). BEDR og AAFY finner du i datasettet \"Underenheter\".Informasjon om næringskoder er basert på Norsk standard for næringsgruppering (SN2007).Enheter som for eksempel er under konkursbehandling, tvangsoppløsning eller tvangsavvikling inngår i datasettet. Det er først ved sletting av enheter at disse utelates.Viktig statusinformasjon kan sjekkes ved søk i Brønnøysundregistrenes elektroniske kunngjøringstjeneste. Dersom det er behov for ytterligere data, som ikke er tilgjengelig via datahotellet, finnes følgende alternativ:Nøkkelopplysninger fra EnhetsregisteretProdukter og tjenester i AltinnBrønnøysundregistrenes nettbaserte bestillingsløsningBestillinger av «skreddersydd» foretaksinformasjon/statistikker"
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003e\u003ca href\u003d\"https://www.brreg.no/om-oss/oppgavene-vare/alle-registrene-vare/om-enhetsregisteret/\" rel\u003d\"nofollow\"\u003eEnhetsregisteret\u003c/a\u003e har som hovedoppgave å samordne opplysninger om næringslivet og offentlige etater som finnes i ulike offentlige registre. Enhetsregisteret inneholder grunndata om enheter som har registreringsplikt i NAV Aa-registeret, Merverdiavgiftsregisteret, Foretaksregisteret, Statistisk sentralbyrås bedriftsregister, Skattedirektoratets register over upersonlige skatteytere eller Stiftelsesregisteret. Alle registrerte enheter identifiseres med en entydig identifikator, et ni-sifret organisasjonsnummer.\u003c/p\u003e\u003cp\u003eFra data.brreg.no og hotell.difi.no kan du benytte API for både søk i og nedlasting av komplett datasett. Ved direkteoppslag får du tilgang til informasjon fra data.brreg.no i sanntid. Fra hotell.difi.no er det i hovedsak en forsinkelse i oppdateringshyppighet på ca 8-24 t. Komplett datasett for begge tjenenstene er basert forhåndsprodusert uttrekk hver natt (med unntak av natt til lørdag og mandag, hvor det ikke produseres filbasert datauttrekk).\u003c/p\u003e\u003cp\u003eDatasettet omfatter utvalgte informasjonselementer for samtlige registrerte enheter i Enhetsregisteret, med unntak av organisasjonsformene TVAM (tvangsregistrert for mva), BEDR (underenheter/avdeling), AAFY (underenhet til ikke-næringsdrivende enhet) og UTLA (utenlandsk enhet). Enheter som er slettet i Enhetsregisteret er utelatt i datafilen. I overkant av 1 000 000 enheter inngår i datasettet, hvorav enkeltpersonforetak og aksjeselskap utgjør ca 80 % av bestanden (tall per 01.11.15). BEDR og AAFY finner du i datasettet \"Underenheter\".\u003c/p\u003e\u003cp\u003eInformasjon om næringskoder er basert på \u003ca href\u003d\"http://www.ssb.no/klass/#/klassifikasjoner/6\" rel\u003d\"nofollow\"\u003eNorsk standard for næringsgruppering (SN2007)\u003c/a\u003e.\u003c/p\u003e\u003cp\u003eEnheter som for eksempel er under konkursbehandling, tvangsoppløsning eller tvangsavvikling inngår i datasettet. Det er først ved sletting av enheter at disse utelates.\u003c/p\u003e\u003cp\u003eViktig statusinformasjon kan sjekkes ved søk i \u003ca href\u003d\"http://w2.brreg.no/kunngjoring/\" rel\u003d\"nofollow\"\u003eBrønnøysundregistrenes elektroniske kunngjøringstjeneste.\u003c/a\u003e Dersom det er behov for ytterligere data, som ikke er tilgjengelig via datahotellet, finnes følgende alternativ:\u003c/p\u003e\u003cp\u003e\u003ca href\u003d\"http://w2.brreg.no/enhet/sok/\" rel\u003d\"nofollow\"\u003eNøkkelopplysninger fra Enhetsregisteret\u003c/a\u003e\u003c/p\u003e\u003cp\u003e\u003ca href\u003d\"https://www.altinn.no/skjemaoversikt/bronnoysundregistrene/produkter-og-tjenester-fra-bronnoysundregistrene-for-privatperson/\" rel\u003d\"nofollow\"\u003eProdukter og tjenester i Altinn\u003c/a\u003e\u003c/p\u003e\u003cp\u003e\u003ca href\u003d\"https://w2.brreg.no/eHandelPortal/ecomsys/\" rel\u003d\"nofollow\"\u003eBrønnøysundregistrenes nettbaserte bestillingsløsning\u003c/a\u003e\u003c/p\u003e\u003cp\u003e\u003ca href\u003d\"https://www.brreg.no/produkter-og-tjenester/bestille-produkter/tilpasset-uttrekk-registerinformasjon/\" rel\u003d\"nofollow\"\u003eBestillinger av «skreddersydd» foretaksinformasjon/statistikker\u003c/a\u003e\u003c/p\u003e"
