  "title": {
    "nb": "Registeret for offentlig støtte"
  },
  "description": {
    "nb": "Registeret for offentlig støtte ble opprettet 1. juli 2016 med bakgrunn i EØS-avtalens regler.Formålet med registeret er blant annet å skape mer åpenhet rundt offentlig støtte.I tjenesten kan du:- søke på foretak som har mottatt offentlig støtte fra og med 1. juli 2016- laste ned søkeresultat og/eller et komplett datasett fra Registeret for offentlig støtte (JSON, XML og CSV-format)Registeret omfatter enkelttildelinger av offentlig støtte til foretak på 500 000 euro eller mer, men det er også mulig for støttegivere å melde tildelinger under dette beløpet.Det er støttegiverne som har plikt til å registrere støttetildelinger. På grunn av støttegivers meldefrist, vil registeret først vise en fullstendig oversikt over meldepliktige støttetildelinger senest innen 6 måneder etter at tildelingen er vedtatt. Støtte som er gitt i form av skatte- eller avgiftsfordel, meldes inn til registeret innen ett år fra det tidspunkt kravet om innlevering av selvangivelse forfaller.Filene som inneholder komplett datasett blir produsert hver gang du gjør en nedlastning. Søket gjøres direkte mot Brønnøysundregistrenes databaser. Dette betyr at du til enhver tid kan finne oppdaterte opplysninger fra Registeret for offentlig støtte."
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eRegisteret for offentlig støtte ble opprettet 1. juli 2016 med bakgrunn i EØS-avtalens regler.\u003c/p\u003e\u003cp\u003eFormålet med registeret er blant annet å skape mer åpenhet rundt offentlig støtte.\u003c/p\u003e\u003cp\u003eI tjenesten kan du:\u003c/p\u003e\u003cp\u003e- søke på foretak som har mottatt offentlig støtte fra og med 1. juli 2016\u003c/p\u003e\u003cp\u003e- laste ned søkeresultat og/eller et komplett datasett fra Registeret for offentlig støtte (JSON, XML og CSV-format)\u003c/p\u003e\u003cp\u003eRegisteret omfatter enkelttildelinger av offentlig støtte til foretak på 500 000 euro eller mer, men det er også mulig for støttegivere å melde tildelinger under dette beløpet.\u003c/p\u003e\u003cp\u003eDet er støttegiverne som har plikt til å registrere støttetildelinger. På grunn av støttegivers meldefrist, vil registeret først vise en fullstendig oversikt over meldepliktige støttetildelinger senest innen 6 måneder etter at tildelingen er vedtatt. Støtte som er gitt i form av skatte- eller avgiftsfordel, meldes inn til registeret innen ett år fra det tidspunkt kravet om innlevering av selvangivelse forfaller.\u003c/p\u003e\u003cp\u003eFilene som inneholder komplett datasett blir produsert hver gang du gjør en nedlastning. Søket gjøres direkte mot Brønnøysundregistrenes databaser. Dette betyr at du til enhver tid kan finne oppdaterte opplysninger fra Registeret for offentlig støtte.\u003c/p\u003e"
