  },
  "description": {
    "nb": "Standarden er basert på den internasjonale standarden for yrkesklassifisering, International Standard Classification of Occupations 2008 - ISCO-08. Strukturen er hierarkisk og er delt inn med fire sifre: 1. siffer \u003d yrkesfelt, 2. siffer \u003d yrkesområde, 3. siffer \u003d yrkesgruppe, 4. siffer \u003d yrke. Et yrke er karakterisert ved ensartethet i arbeidsoppgaver, kompetansenivå og spesialisering.Standard for yrkesklassifisering er beregnet for bruk i offisiell norsk statistikk og vil også være et viktig verktøy innen arbeidsformidling og yrkesrettledning. Men for innrapportering av yrker til A-ordningen skal en bruke Yrkeskatalogen (7 siffer)."
  },
