  "title": {
    "nb": "Kulturminnesøk"
  },
  "description": {
    "nb": "Riksantikvaren tilbyr API mot datasett i publikumstjenesten Kulturminnesøk, som baserer seg på åpne data fra forvaltningsdatabasen Askeladden. Datasettene inneholder data om kulturminner inndelt i lokaliteter og enkeltminner, med faktaopplysninger, beskrivelser og kartfesting med tilhørende sikringssoner.Dataene er publisert på en ArcGIS server. ArcGIS server brukes ofte i forbindelse med kartapplikasjoner, men serveren har også et REST-grensesnitt som for eksempel web-applikasjoner kan gjøre uttrekk av dataene gjennom. Grensesnittet returnerer objekter i HTML eller JSON format.Vedlagt er også en lenke til Riksantikvaren sine datasett hos GeoNorge, der noen av datassettene fra Kulturminnesøk også finnes i andre formater/distribusjoner (Lokaliteter, Enkeltminner, Kulturmiljøer, Sikringssoner og Freda bygninger) "
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eRiksantikvaren tilbyr API mot datasett i publikumstjenesten \u003ca href\u003d\"http://www.kulturminnesok.no/\" rel\u003d\"nofollow\"\u003eKulturminnesøk\u003c/a\u003e, som baserer seg på åpne data fra forvaltningsdatabasen Askeladden. Datasettene inneholder data om kulturminner inndelt i lokaliteter og enkeltminner, med faktaopplysninger, beskrivelser og kartfesting med tilhørende sikringssoner.\u003c/p\u003e\u003cp\u003eDataene er publisert på en ArcGIS server. ArcGIS server brukes ofte i forbindelse med kartapplikasjoner, men serveren har også et REST-grensesnitt som for eksempel web-applikasjoner kan gjøre uttrekk av dataene gjennom. Grensesnittet returnerer objekter i HTML eller JSON format.\u003c/p\u003e\u003cp\u003eVedlagt er også en lenke til Riksantikvaren sine datasett hos GeoNorge, der noen av datassettene fra Kulturminnesøk også finnes i andre formater/distribusjoner (Lokaliteter, Enkeltminner, Kulturmiljøer, Sikringssoner og Freda bygninger) \u003c/p\u003e"
