  "title": {
    "nb": "Vannverk - behandlingsanlegg_innrapportering"
  },
  "description": {
    "nb": "Datasettene gir oversikt over utvalgte data om vannverk som er registrert hos Mattilsynet. Informasjonen er meldt inn av vannverkene gjennom søknadsbehandlinger eller ved annen innrapportering til Mattilsynet. Drikkevannsforskriften krever bl.a. årlig innrapportering. Mattilsynet har laget en egen skjematjeneste for slik innrapportering.Datasettene omfatter offentlige eller private vannverk som forsyner 50 personer eller mer. I tillegg inngår alle kommunalt eide virksomheter med egen vannforsyning uavhengig av størrelse. Datasettene inneholder også nedlagte anlegg. Dette gjøres av hensyn til dem som ønsker å se historiske data, dvs data for foregående år eller tidligere.Det er datasett for følgende tilsynsobjekter:1. Vannforsyningssystem. Omfatter også analyser av drikkevannet.2. Transportsystem3. Behandlingsanlegg4. Inntakspunkt. Omfatter også analyser av vannkilden.Nedenfor finner du datasett for 3. behandlingsanlegg_innrapportering. Filen gir oversikt over mengde vann produsert ved de enkelte behandlingsanleggene.I tillegg er det en fil (informasjon.txt) som gir oversikt over når uttrekkene ble produsert og hvor mange linjer det er i de enkelte filene. Uttrekkene gjøres ukentlig.For datasettene vannforsyningssystem, transportsystem og inntakspunkt er det dessuten mulig å se historiske data over det som inngår i den årlige innrapporteringen. For å nyttiggjøre den informasjonen så må filen knyttes opp mot «moder filen» for å få frem navn og annen statisk informasjon. Disse filene har endelsen _innrapportering i filnavnet.Beskrivelse av datafeltene (dvs. metadata) i de enkelte datasettene fremkommer i egne filer. Disse foreligger i pdf format.Hvis man dobbelt-klikker csv filen og den åpner seg direkte i excel, så vil man ikke få æøå. For å se tegnsettet korrekt i excel må du:• starte excel og et nytt regneark• velg data og deretter fra text, trykk importer• velg data med skilletegn, og filopprinnelse \"65001: Unicode (UTF-8)\" og hak av \"Mine data har overskrifter\" og trykk neste• velg bort tabulator som skilletegn og velg semikolon som skilletegn, trykk neste• fullførDatasettene kan for øvrig importeres i en egen database og sammenstilles slik man ønsker. Det er koblingsnøkler i filene som gjør det mulig å knytte filene sammen.Vannverkene er ansvarlig for kvaliteten på datasettene."
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eDatasettene gir oversikt over utvalgte data om vannverk som er registrert hos Mattilsynet. Informasjonen er meldt inn av vannverkene gjennom søknadsbehandlinger eller ved annen innrapportering til Mattilsynet. Drikkevannsforskriften krever bl.a. årlig innrapportering. Mattilsynet har laget en egen skjematjeneste for slik innrapportering.\u003c/p\u003e\u003cp\u003eDatasettene omfatter offentlige eller private vannverk som forsyner 50 personer eller mer. I tillegg inngår alle kommunalt eide virksomheter med egen vannforsyning uavhengig av størrelse. Datasettene inneholder også nedlagte anlegg. Dette gjøres av hensyn til dem som ønsker å se historiske data, dvs data for foregående år eller tidligere.\u003c/p\u003e\u003cp\u003eDet er datasett for følgende tilsynsobjekter:\u003cbr\u003e1. Vannforsyningssystem. Omfatter også analyser av drikkevannet.\u003cbr\u003e2. Transportsystem\u003cbr\u003e3. Behandlingsanlegg\u003cbr\u003e4. Inntakspunkt. Omfatter også analyser av vannkilden.\u003c/p\u003e\u003cp\u003e\u003cstrong\u003eNedenfor finner du datasett for 3. behandlingsanlegg_innrapportering. \u003c/strong\u003eFilen gir oversikt over mengde vann produsert ved de enkelte behandlingsanleggene.\u003c/p\u003e\u003cp\u003eI tillegg er det en fil (informasjon.txt) som gir oversikt over når uttrekkene ble produsert og hvor mange linjer det er i de enkelte filene. Uttrekkene gjøres ukentlig.\u003c/p\u003e\u003cp\u003eFor datasettene vannforsyningssystem, transportsystem og inntakspunkt er det dessuten mulig å se historiske data over det som inngår i den årlige innrapporteringen. For å nyttiggjøre den informasjonen så må filen knyttes opp mot «moder filen» for å få frem navn og annen statisk informasjon. Disse filene har endelsen _innrapportering i filnavnet.\u003c/p\u003e\u003cp\u003eBeskrivelse av datafeltene (dvs. metadata) i de enkelte datasettene fremkommer i egne filer. Disse foreligger i pdf format.\u003c/p\u003e\u003cp\u003eHvis man dobbelt-klikker csv filen og den åpner seg direkte i excel, så vil man ikke få æøå. For å se tegnsettet korrekt i excel må du:\u003cbr\u003e• starte excel og et nytt regneark\u003cbr\u003e• velg data og deretter fra text, trykk importer\u003cbr\u003e• velg data med skilletegn, og filopprinnelse \"65001: Unicode (UTF-8)\" og hak av \"Mine data har overskrifter\" og trykk neste\u003cbr\u003e• velg bort tabulator som skilletegn og velg semikolon som skilletegn, trykk neste\u003cbr\u003e• fullfør\u003c/p\u003e\u003cp\u003eDatasettene kan for øvrig importeres i en egen database og sammenstilles slik man ønsker. Det er koblingsnøkler i filene som gjør det mulig å knytte filene sammen.\u003cbr\u003eVannverkene er ansvarlig for kvaliteten på datasettene.\u003c/p\u003e"
  },
