  "title": {
    "nb": "Kravpunkter for smilefjestilsyn på serveringssteder"
  },
  "description": {
    "nb": "Data fra smilefjestilsyn gir en samlet oversikt over alle serveringssteder som er omfattet av smilefjesordningen (smilefjesforskriften) og tilsynsresultatene fra Mattilsynets tilsyn fra 1.1. 2016 fram til dags dato.Datasettet \"Kravpunkter for smilefjestilsyn på serveringssteder\" inneholder hvert enkelt kravpunkt som inngår i ett tilsyn, sammen med karakteren kravpunktet er gitt. Hvert tilsyn vil ha et sett med rader i dette tilsynet, knyttet sammen av tilsynid.Datasettet er relatert til Smilefjestilsyn på serveringssteder som inneholder den tilsvarende informasjonen som plakaten som henges opp hos spisestedene etter at de har hatt tilsyn.Beskrivelse av elementene i datasettet for smilefjesKravpunkt:Krav i regelverket satt opp som punkter. Kravene retter seg mot tilsynsobjektene og Mattilsynet fører tilsyn med kravene. Kravpunktene er ett spesifikt element i ett tilsyn. Disse kan være obligatoriske ved ordinært tilsyn (se tilsyn).Avvik:Ett kravpunkt som har blitt undersøkt, og hvor Mattilsynet har funnet brudd på regelverket som fører til at det varsles eller fattes vedtak overfor tilsynsobjektet.Tema:Organisering av kravpunkter som benyttes på smilefjesplakaten for å gruppere kravpunkter.Tilsyn:Mattilsynets tilsynsprosess består av et ordinært tilsyn, med påfølgende oppfølgingstilsyn til alle avvik er lukket/utbedret eller tilsynsobjektet legger ned aktiviteten. Når vi utfører et ordinært tilsyn vil alle kravpunkter være mulig å vurdere, men det legges ikke opp til at alle kravpunkter vil bli vurdert ved hvert ordinære tilsyn. På oppfølgingstilsyn vurderes normalt bare de kravpunkt som det ble funnet avvik på, med mindre det har oppstått helt åpenbare avvik (eller det er mistanke om avvik) ved øvrige kravpunkter siden forrige tilsyn.Karakterskala:0 \u003d Ingen brudd på regelverket funnet. Stort smil.1 \u003d Mindre brudd på regelverket som ikke krever oppfølging. Stort smil.2 \u003d Brudd på regelverket som krever oppfølging. Strekmunn.3 \u003d Alvorlig brudd på regelverket. Sur munn.4 \u003d Ikke aktuelt - Virksomheten har ikke denne aktiviteten ved tilsynsobjektet. Påvirker ikke smilefjeskarakter.5 \u003d Ikke vurdert - Mattilsynet har ikke vurdert kravpunktet ved dette tilsynet. Påvirker ikke smilefjeskarakter. Dersom det hadde blitt avdekket mistanke om vesentlige eller åpenbare avvik i forbindelse med inspeksjonen, ville kravpunktet blitt vurdert.Karaktersetting:Det totale smilefjesymbolet etter et tilsyn tilsvarer den dårligste karakteren som blir gitt på tilsynet. Karakter for hvert tema er den dårligste karakteren gitt til kravpunkter under tema.Hvert enkelt kravpunkt gis karakterer på skalaen.Invalidering av tilsyn:Dersom Mattilsynet ikke overholder sine forpliktelser i smilefjesforskriften, eller et påklaget vedtak gis medhold, vil tilsynet og tilsynsresultatet bli trukket tilbake fra åpne data. Informasjonen om dette tilsynet vil ikke lenger være ansett som korrekt. Det er derfor viktig at brukere av datasettet er klar over dette slik at de kan holde sine data oppdatert (1 gang pr. døgn) for å unngå publisering av feilaktig informasjon om et tilsynsobjekt.Deklarasjon av innholdet i datasettet Kravpunkter:Dette datasettet inneholder hvert enkelt kravpunkt som inngår i ett tilsyn, sammen med karakteren kravpunktet er gitt. Hvert tilsyn vil ha ett sett med rader i dette tilsynet, knyttet sammen av tilsynid.\"tilsynid\"; - Nøkkel for identifisere ett tilsyn\"dato\"; - Dato tilsynet er utført\"tema.kravpunkt\"; - Nøkkel for å identifisere ett kravpunkt (ikke unik over tid)\"kravpunktnavn\"; - Navn på kravpunktet\"karakter\"; - Karakter (utifra skala)\"tekst_no\"; - Tekstlig beskrivelse av karakter, bokmål\"tekst_nn\"; - Tekstlig beskrivelse av karakter, nynorsk\"tilsyn_href\";\" - Lenke til tilsynet, slik at kravpunkter kan kobles sammen med tilsynsobjektet"
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eData fra smilefjestilsyn gir en samlet oversikt over alle serveringssteder som er omfattet av smilefjesordningen (\u003ca href\u003d\"https://lovdata.no/dokument/SF/forskrift/2015-09-25-1141\" rel\u003d\"nofollow\"\u003esmilefjesforskriften\u003c/a\u003e) og tilsynsresultatene fra Mattilsynets tilsyn fra 1.1. 2016 fram til dags dato.\u003c/p\u003e\u003cp\u003eDatasettet \"Kravpunkter for smilefjestilsyn på serveringssteder\" inneholder hvert enkelt kravpunkt som inngår i ett tilsyn, sammen med karakteren kravpunktet er gitt. Hvert tilsyn vil ha et sett med rader i dette tilsynet, knyttet sammen av tilsynid.\u003c/p\u003e\u003cp\u003eDatasettet er relatert til \u003ca href\u003d\"http://data.norge.no/data/mattilsynet/smilefjestilsyn-p%C3%A5-serveringssteder\" rel\u003d\"nofollow\"\u003eSmilefjestilsyn på serveringssteder\u003c/a\u003e som inneholder den tilsvarende informasjonen som plakaten som henges opp hos spisestedene etter at de har hatt tilsyn.\u003c/p\u003e\u003cp\u003e\u003cstrong\u003eBeskrivelse av elementene i datasettet for smilefjes\u003c/strong\u003e\u003c/p\u003e\u003cp\u003e\u003cstrong\u003eKravpunkt:\u003c/strong\u003e\u003cbr\u003eKrav i regelverket satt opp som punkter. Kravene retter seg mot tilsynsobjektene og Mattilsynet fører tilsyn med kravene. Kravpunktene er ett spesifikt element i ett tilsyn. Disse kan være obligatoriske ved ordinært tilsyn (se tilsyn).\u003c/p\u003e\u003cp\u003e\u003cstrong\u003eAvvik:\u003c/strong\u003e\u003cbr\u003eEtt kravpunkt som har blitt undersøkt, og hvor Mattilsynet har funnet brudd på regelverket som fører til at det varsles eller fattes vedtak overfor tilsynsobjektet.\u003c/p\u003e\u003cp\u003e\u003cstrong\u003eTema:\u003c/strong\u003e\u003cbr\u003eOrganisering av kravpunkter som benyttes på smilefjesplakaten for å gruppere kravpunkter.\u003c/p\u003e\u003cp\u003e\u003cstrong\u003eTilsyn:\u003c/strong\u003e\u003cbr\u003eMattilsynets tilsynsprosess består av et ordinært tilsyn, med påfølgende oppfølgingstilsyn til alle avvik er lukket/utbedret eller tilsynsobjektet legger ned aktiviteten. Når vi utfører et ordinært tilsyn vil alle kravpunkter være mulig å vurdere, men det legges ikke opp til at alle kravpunkter vil bli vurdert ved hvert ordinære tilsyn. På oppfølgingstilsyn vurderes normalt bare de kravpunkt som det ble funnet avvik på, med mindre det har oppstått helt åpenbare avvik (eller det er mistanke om avvik) ved øvrige kravpunkter siden forrige tilsyn.\u003c/p\u003e\u003cp\u003e\u003cstrong\u003eKarakterskala:\u003c/strong\u003e\u003cbr\u003e0 \u003d Ingen brudd på regelverket funnet. Stort smil.\u003cbr\u003e1 \u003d Mindre brudd på regelverket som ikke krever oppfølging. Stort smil.\u003cbr\u003e2 \u003d Brudd på regelverket som krever oppfølging. Strekmunn.\u003cbr\u003e3 \u003d Alvorlig brudd på regelverket. Sur munn.\u003cbr\u003e4 \u003d Ikke aktuelt - Virksomheten har ikke denne aktiviteten ved tilsynsobjektet. Påvirker ikke smilefjeskarakter.\u003cbr\u003e5 \u003d Ikke vurdert - Mattilsynet har ikke vurdert kravpunktet ved dette tilsynet. Påvirker ikke smilefjeskarakter. Dersom det hadde blitt avdekket mistanke om vesentlige eller åpenbare avvik i forbindelse med inspeksjonen, ville kravpunktet blitt vurdert.\u003c/p\u003e\u003cp\u003e\u003cstrong\u003eKaraktersetting:\u003c/strong\u003e\u003cbr\u003eDet totale smilefjesymbolet etter et tilsyn tilsvarer den dårligste karakteren som blir gitt på tilsynet. Karakter for hvert tema er den dårligste karakteren gitt til kravpunkter under tema.\u003cbr\u003eHvert enkelt kravpunkt gis karakterer på skalaen.\u003c/p\u003e\u003cp\u003e\u003cstrong\u003eInvalidering av tilsyn:\u003c/strong\u003e\u003cbr\u003eDersom Mattilsynet ikke overholder sine forpliktelser i smilefjesforskriften, eller et påklaget vedtak gis medhold, vil tilsynet og tilsynsresultatet bli trukket tilbake fra åpne data. Informasjonen om dette tilsynet vil ikke lenger være ansett som korrekt. Det er derfor viktig at brukere av datasettet er klar over dette slik at de kan holde sine data oppdatert (1 gang pr. døgn) for å unngå publisering av feilaktig informasjon om et tilsynsobjekt.\u003c/p\u003e\u003cp\u003e\u003cstrong\u003eDeklarasjon av innholdet i datasettet\u003c/strong\u003e\u003c/p\u003e\u003cp\u003e \u003c/p\u003e\u003cp\u003e\u003cstrong\u003eKravpunkter:\u003c/strong\u003e\u003cbr\u003eDette datasettet inneholder hvert enkelt kravpunkt som inngår i ett tilsyn, sammen med karakteren kravpunktet er gitt. Hvert tilsyn vil ha ett sett med rader i dette tilsynet, knyttet sammen av tilsynid.\u003c/p\u003e\u003cp\u003e\"tilsynid\"; - Nøkkel for identifisere ett tilsyn\u003cbr\u003e\"dato\"; - Dato tilsynet er utført\u003cbr\u003e\"tema.kravpunkt\"; - Nøkkel for å identifisere ett kravpunkt (ikke unik over tid)\u003cbr\u003e\"kravpunktnavn\"; - Navn på kravpunktet\u003cbr\u003e\"karakter\"; - Karakter (utifra skala)\u003cbr\u003e\"tekst_no\"; - Tekstlig beskrivelse av karakter, bokmål\u003cbr\u003e\"tekst_nn\"; - Tekstlig beskrivelse av karakter, nynorsk\u003cbr\u003e\"tilsyn_href\";\" - Lenke til tilsynet, slik at kravpunkter kan kobles sammen med tilsynsobjektet\u003c/p\u003e"
