  "title": {
    "nb": "Ruteplan for sykkel"
  },
  "description": {
    "nb": "Datasett til bruk i ruteberegninger for syklende og gående.Statens vegvesen har brukt store ressurser på etablering av gang- og sykkelvegdata i Nasjonal vegdatabank. Formålet med dataetableringen har primært vært bedre drift og vedlikehold av gang- og sykkelvegnettet, og gjennom dette prosjektet ønsker vi å synliggjøre at sykkelvegdataene i NVDB har stor verdi også innen andre bruksområder.Det finnes ikke noe offisielt nasjonalt datasett som enkelt gir mulighet for digital sykkelruteplanlegging, men NVDB-data i kombinasjon med andre datakilder vil kunne danne grunnlaget for et slikt datasett. Her er data fra NVDB supplert med blant annet stier, traktorveger og småstubber fra Open Street Map.For nyheter, driftsmeldinger og tips om data fra Statens vegvesen, følg oss på twitter.com/VegvesenData."
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eDatasett til bruk i ruteberegninger for syklende og gående.\u003c/p\u003e\u003cul\u003e\u003cli\u003eStatens vegvesen har brukt store ressurser på etablering av gang- og sykkelvegdata i \u003ca href\u003d\"https://data.norge.no/data/statens-vegvesen/nasjonal-vegdatabank-api\" rel\u003d\"nofollow\"\u003eNasjonal vegdatabank\u003c/a\u003e. Formålet med dataetableringen har primært vært bedre drift og vedlikehold av gang- og sykkelvegnettet, og gjennom dette prosjektet ønsker vi å synliggjøre at sykkelvegdataene i NVDB har stor verdi også innen andre bruksområder.\u003c/li\u003e\u003cli\u003eDet finnes ikke noe offisielt nasjonalt datasett som enkelt gir mulighet for digital sykkelruteplanlegging, men NVDB-data i kombinasjon med andre datakilder vil kunne danne grunnlaget for et slikt datasett. Her er data fra NVDB supplert med blant annet stier, traktorveger og småstubber fra \u003ca href\u003d\"http://www.openstreetmap.org/\" rel\u003d\"nofollow\"\u003eOpen Street Map\u003c/a\u003e.\u003c/li\u003e\u003c/ul\u003e\u003cp\u003eFor nyheter, driftsmeldinger og tips om data fra Statens vegvesen, følg oss på \u003ca href\u003d\"https://twitter.com/VegvesenData\" rel\u003d\"nofollow\"\u003etwitter.com/VegvesenData\u003c/a\u003e.\u003c/p\u003e"
