  "description": {
    "nb": "NB! Bruk heller trafikkinformasjon på DATEX-format! Denne tjenesten vil etter hvert bli utfaset.På vegvesenets trafikksider finner du oppdaterte veg- og trafikkmeldinger for hele landet i XML-format.Trafikkmeldingene distribueres også via:Radio (riksdekkende og lokalt)RDS-TA - Radio Data System, Traffic Announcement (NRK P1)NRK1 Tekst-TV (fra side 700)www.175.no eller www.vegvesen.no/trafikk/mobil/ - trafikkmeldinger tilrettelagt for mobiltelefoner/PDATilbakemeldinger og spørsmål om tjenesten kan sendes til www-admin@vegvesen.no. Gjelder det veg- og trafikkmeldingens innhold, kan Statens vegvesen kontaktes på tlf. 175 (fra utlandet +47 815 48 991). For nyheter, driftsmeldinger og tips om data fra Statens vegvesen, følg oss på twitter.com/VegvesenData."
  },
  "descriptionFormatted": {
