  "title": {
    "nb": "Rapportert netto overskuddsandel per selskap for 2009"
  },
  "description": {
    "nb": "Extractive Industries Transparency Initiative (EITI) er et initiativ fra den tidligere britiske statsminister Tony Blair om å øke åpenheten omkring betalingsstrømmer innenfor petroleums- og gruveindustrien. Norge har siden 2003 aktivt støttet dette initiativet politisk og økonomisk.EITI har utarbeidet et sett av prinsipper for åpenhet og godt styresett som også forutsetter aktiv deltagelse fra det sivile samfunn. En rekke land, selskaper og organisasjoner har sluttet seg til disse prinsippene. Videre er det et sett av kriterier som må oppfylles av de land som velger å implementere EITI.Norske EITI-tall for 2009 er publisert i XLS-format på regjeringen.no. Les mer om hva EITI er på temasidene på regjeringen.no."
  },
