  "title": {
    "nb": "SR16 - Skogressurskart 16x16 meter - Vektor"
  },
  "description": {
    "nb": "SR16 er et heldekkende datasett som gir oversikt over utbredelsen og egenskaper ved landets skogressurser. SR16 er delt opp i SR16R som er et rasterkart og SR16V som er et vektorkart.\n\nDatasettet er fremstilt gjennom automatiske prosesser som en kombinasjon av eksiterende kart (AR5), terrengmodeller, 3D fjernmålingsdata (fotogrammetri og laser) og landsskogflater.\n\nSR16 er fremstilt som et pikselkart (16 x 16 meter) og som et vektorkart som generaliserer pikselkartet til større figurer (polygoner) av relativ homogen skog. De fleste egenskapene i SR16V er beregnet som et gjennomsnitt av verdiene fra pikslene i SR16R."
  },
  "descriptionFormatted": {
    "nb": "SR16 er et heldekkende datasett som gir oversikt over utbredelsen og egenskaper ved landets skogressurser. SR16 er delt opp i SR16R som er et rasterkart og SR16V som er et vektorkart.\n\nDatasettet er fremstilt gjennom automatiske prosesser som en kombinasjon av eksiterende kart (AR5), terrengmodeller, 3D fjernmålingsdata (fotogrammetri og laser) og landsskogflater.\n\nSR16 er fremstilt som et pikselkart (16 x 16 meter) og som et vektorkart som generaliserer pikselkartet til større figurer (polygoner) av relativ homogen skog. De fleste egenskapene i SR16V er beregnet som et gjennomsnitt av verdiene fra pikslene i SR16R."
  },
