  "description": {
    "nb": "N50 Raster har lik presentasjon (symbolikk) som kartserien Norge 1:50 000. N50 Raster er begrenset av riksgrensen mot nabolandene og territorialgrensen i havet. Datasettet inneholder sjøinformasjon.\n\nN50 Raster baserer seg på N50 Kartdata og distribueres ukentlig.\n\nFylkesvise filer leveres kun på MrSID-format. MrSID-dataene leveres i to kvaliteter, normal og høy. Filene i høy kvalitet inneholder fjellskygge og sjøinformasjon.\n\nØnskes N50 Raster på GeoTIFF-format må dette lastes ned i ruter á 20 km x 20 km. Disse filene kan lastes ned fra www.geonorge.no under oppføringen N50 Raster - Rutevis\nFølgende referansefil medfølger GeoTIFF-formatet: SOSI og TFW."
