  "title": {
    "nb": "Jordsmonn - Begrensende egenskaper"
  },
  "description": {
    "nb": "Kartlag i datasettet Jordsmonn som viser hvilken begrensende jordegenskap som er den viktigste årsaken til at en kartfigur har kommet i sin respektive jordressursklasse. Denne egenskapen/kartlaget henger sammen med «Jordressursklasser». Rundt halvparten av Norges fulldyrka og overflatedyrka jord er jordsmonnskartlagt, med hovedvekt på Sør-Østlandet, Trøndelag og Jæren. På enkelte steder er også også innmarksbeite kartlagt. Kartlaget er fremstilt i målestokk 1:5000 og er tilpasset bruk i målestokker fra 1:5000 til 1:20 000. Egenskap som skal brukes til å fremstille kartlaget heter JR_DREN."
  },
