  "description": {
    "nb": "FKB-Servitutt inneholder rettigheter til eiendom som ikke skal registeres i Matrikkelen. Servitutter er andre typer rettigheter til eiendom enn eiendomsrett og feste. Dette kan for eksempel være bruksrett til skog, veg eller beite. Representasjonspunktet blir kodet med gårds-/bruks-/festenummer til bruksretten hvis den har dette. I tillegg blir det kodet hva slags bruksrettighet eller råderettsinnskrenking som ligger til teigen.\n\nFor å få en komplett oversikt over servitutter for en eiendom må man gjøre oppslag i Grunnboka. FKB-Servitutt er ikke komplett og inneholder bare noen typer servitutter."
  },
