  "title": {
    "nb": "Europa, Illustrasjonskart"
  },
  "description": {
    "nb": "Nord-Europa: \nKartet dekker området fra Svalbard i nord til Belgia i sør. Kartet finnes i to versjoner, en med norske stedsnavn og en med engelske stedsnavn.\nEuropa:\nDet finnes to kart i nedlastingspakken, ett kart med samme bunntone på hele kartet, og ett kart der landene er skilt med ulike farger.\n\nKartene inneholder landegrenser og navn på land og hovedsteder/byer. De enkelte land er framstilt som egne flater som brukeren kan endre fargene på (AI- og PPT-formatene).\n\nDataene distribueres som JPEG, EMF, PPT og AI (Adobe Illustrator-fil)."
  },
